import React, { Component } from 'react'
import {
    Input, List, Card, Pagination,
    Drawer, Form, Button, Col, Row, Space, Select, message
} from 'antd';
import {
    PlusOutlined
} from '@ant-design/icons';

const { Search } = Input

export default class Order extends Component {
    render() {
        return (
            <div>
                <div>
                    <Card
                        title={<span style={{ fontSize: '30px' }}>车厢管理</span>}
                    >
                        <div className="search">
                            <Search placeholder="车次" />
                            <Search placeholder="乘客姓名" />
                            <Search placeholder="乘客身份证" />
                        </div>
                        <List
                            className="site-list"
                            grid={{ gutter: 16, column: 4 }}
                            dataSource={[]}
                            renderItem={item => (
                                <List.Item>
                                    <Card style={{ textAlign: 'center' }}>成都</Card>
                                </List.Item>
                            )}
                        />
                        <Pagination className="site-pagination" defaultCurrent={1} total={500} />
                    </Card>
                </div>
            </div>
        )
    }
}
